  false,\n\t\"url\": null,\n\t\"notes\": \"The Resources of Concern Selection Tool
  for Americas Refuges (ROCSTAR) was developed to assist national wildlife refuges,
  waterfowl production areas, wetland management districts, and other conservation
  lands in identifying priority resources for management and monitoring. Specifically,
  ROCSTAR helps to identify priority resources of concern as defined by the U.S. Fish
  and Wildlife Serviceu2019s (the Service) Identifying Refuge Resources of Concern
  and Management Priorities: A Handbook (the Handbook). This tool is intended to assist
  managers and planners in completing the selection process outlined within the Handbook.
  ROCSTAR is a decision-support tool that allows the resource prioritization and selection
  process to be documented. In doing so, it provides opportunity for review by individuals
  actively identifying priority resources of concern or by individuals reviewing the
  decision making process.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
